-- community 데이터베이스 구조 내보내기
CREATE DATABASE IF NOT EXISTS `community` /*!40100 DEFAULT CHARACTER SET utf8mb3 COLLATE utf8mb3_uca1400_ai_ci */;
USE `community`;

-- 프로시저 community.p_board_range 구조 내보내기
DELIMITER //
CREATE PROCEDURE `p_board_range`(
	IN `range_start` INT,
	IN `range_count` INT
)
BEGIN
	SELECT 
		b.id        AS 'id',
		b.user_id   AS 'user_id',
		u.nickname  AS 'nickname',
		b.title     AS 'title',
		b.content   AS 'content',
		b.create_dt AS 'create_dt',
		b.update_dt AS 'update_dt',
		b.comments  AS 'comments'
	FROM tb_board b 
		LEFT OUTER JOIN tb_user u    ON b.user_id = u.id
	WHERE b.id >= range_start
	ORDER BY b.create_dt ASC 
	LIMIT range_count;
END//
DELIMITER ;

-- 프로시저 community.p_comment_board 구조 내보내기
DELIMITER //
CREATE PROCEDURE `p_comment_board`(
	IN `board_id` INT
)
BEGIN
	SELECT 
		c.id,
		c.user_id,
		u.nickname, 
		c.content,
		c.create_dt,
		c.update_dt
	FROM tb_comment c
		LEFT OUTER JOIN tb_user u ON u.id = c.user_id
	WHERE c.board_id = board_id
	ORDER BY c.update_dt DESC;
END//
DELIMITER ;

-- 프로시저 community.p_user_select 구조 내보내기
DELIMITER //
CREATE PROCEDURE `p_user_select`(
	IN `u_id` VARCHAR(20),
	IN `u_pw` VARCHAR(20)
)
BEGIN
	SELECT 
		u.id AS 'id',
		u.nickname AS 'nickname'
	FROM tb_user u
	WHERE u.login_id = u_id AND u.login_pw = u_pw;
END//
DELIMITER ;

-- 테이블 community.tb_board 구조 내보내기
CREATE TABLE IF NOT EXISTS `tb_board` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '게시글 id',
  `user_id` int(11) unsigned NOT NULL COMMENT '게시글 사용자 id',
  `title` varchar(40) NOT NULL COMMENT '게시글 제목',
  `content` varchar(5000) NOT NULL COMMENT '게시글 내용',
  `create_dt` datetime NOT NULL DEFAULT current_timestamp() COMMENT '게시글 생성 시간',
  `update_dt` datetime NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT '게시글 수정 시간',
  `comments` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '댓글 수',
  `views` int(11) unsigned NOT NULL DEFAULT 0 COMMENT '조회 수',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `FK_tb_board_tb_user` (`user_id`),
  KEY `create_dt` (`create_dt`),
  CONSTRAINT `FK_tb_board_tb_user` FOREIGN KEY (`user_id`) REFERENCES `tb_user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1040 DEFAULT CHARSET=utf8mb3 COLLATE=utf8mb3_uca1400_ai_ci COMMENT='게시글';

