-- VIEW 종속성 오류를 극복하기 위해 임시 테이블을 생성합니다.
CREATE TABLE `v_board` (
	`id` INT(11) UNSIGNED NOT NULL COMMENT '게시글 id',
	`user_id` INT(11) UNSIGNED NOT NULL COMMENT '게시글 사용자 id',
