-- 트리거 community.tr_comment 구조 내보내기
SET @OLDTMP_SQL_MODE=@@SQL_MODE, SQL_MODE='STRICT_TRANS_TABLES,ERROR_FOR_DIVISION_BY_ZERO,NO_AUTO_CREATE_USER,NO_ENGINE_SUBSTITUTION';
DELIMITER //
CREATE TRIGGER `tr_comment` BEFORE INSERT ON `tb_comment` FOR EACH ROW BEGIN
	UPDATE tb_board
	SET tb_board.comments = tb_board.comments + 1
	WHERE tb_board.id = NEW.board_id;
END//
DELIMITER ;
SET SQL_MODE=@OLDTMP_SQL_MODE;

-- 임시 테이블을 제거하고 최종 VIEW 구조를 생성
DROP TABLE IF EXISTS `v_board`;
CREATE ALGORITHM=TEMPTABLE SQL SECURITY DEFINER VIEW `v_board` AS SELECT 
	b.id        AS 'id',
	b.user_id   AS 'user_id',
	u.nickname  AS 'nickname',
	b.title     AS 'title',
	b.content   AS 'content',
	b.create_dt AS 'create_dt',
	b.update_dt AS 'update_dt',
	b.comments  AS 'comments'
FROM tb_board b 
	LEFT OUTER JOIN tb_user u    ON b.user_id = u.id
WHERE 1 = 1
ORDER BY b.create_dt DESC 
;

